import React from "react";






export class Table extends React.Component {
    constructor(props) {
        super(props);
        this.makeTable = this.makeTable.bind(this);
    }

    makeTable() {
        //let propfunction;
        //if (item === 'module'){
        //   propfunction = {this.props.module};
        //} else {
        //    propfunction = {this.props.specialisation};
        //}

       return this.props.module.map((module) => {
            const { code, name, MCs, link } = module
            return (
                <div>
                    <tr key={code}>
                        <td>{code}</td>
                        <td>
                            <a href={link} target="_blank">
                                {name}
                            </a>
                        </td>
                        <td>{MCs}</td>
                    </tr>
                </div>
            )
       })
    }

    makeTable2() {
        //let propfunction;
        //if (item === 'module'){
        //   propfunction = {this.props.module};
        //} else {
        //    propfunction = {this.props.specialisation};
        //}

       return this.props.specialisation.map((module) => {
            const { code, name, MCs, link } = module
            return (
                <div>
                    <tr key={code}>
                        <td>{code}</td>
                        <td>
                            <a href={link} target="_blank">
                                {name}
                            </a>
                        </td>
                        <td>{MCs}</td>
                    </tr>
                </div>
            )
       })
    }

    render() {
        return (
            <div>
                <h3>Core Modules</h3>
                <table>
                    <tbody>{this.makeTable()}</tbody>
                </table>

                <h3>Specialisation Modules</h3>
                <table>
                    <tbody>{this.makeTable2()}</tbody>
                </table>

                <h3>Unrestricted Electives</h3>
                <table>
                    <tbody>{this.makeTable2()}</tbody>
                </table>
            </div>
        )

    }
}
